import React, { useState } from "react";
import imagenLateral from "./Logo.png"; // Asegúrate de tener la imagen en esta ruta

const Formulario = () => {
  const [formData, setFormData] = useState({
    nombre: "",
    email: "",
    password: "",
    confirmPassword: "",
  });

  const [errors, setErrors] = useState({});
  const [focusedField, setFocusedField] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const validate = () => {
    let newErrors = {};

    if (!formData.nombre.trim()) newErrors.nombre = "Campo requerido";
    if (!formData.email.includes("@")) newErrors.email = "Email inválido";
    if (formData.password.length < 6) newErrors.password = "Mínimo 6 caracteres";
    if (formData.password !== formData.confirmPassword)
      newErrors.confirmPassword = "No coincide";

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validate()) {
      alert("Formulario enviado");
      setFormData({
        nombre: "",
        email: "",
        password: "",
        confirmPassword: "",
      });
    }
  };

  const styles = {
    container: {
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      height: "100vh",
      backgroundColor: "#FAFAFA", 
      fontFamily: "Arial, sans-serif",
    },
    card: {
      display: "flex",
      backgroundColor: "#6B8E23",
      borderRadius: "20px",
      boxShadow: "0 4px 12px rgba(190, 16, 16, 0.1)",
      overflow: "hidden",
      width: "800px",
    },
    imageSection: {
      flex: "1",
      backgroundColor: "#FAFAFA",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
    },
    image: {
      width: "80%",
      height: "auto",
    },
    formSection: {
      flex: "1",
      padding: "40px",
      backgroundColor: "#ffffff",
    },
    title: {
      fontSize: "28px",
      fontWeight: "bold",
      marginBottom: "20px",
      color: "#003366",
    },
    label: {
      display: "block",
      marginBottom: "6px",
      color: "#333333",
    },
    input: {
      width: "100%",
      padding: "10px 14px",
      borderRadius: "10px",
      border: "1px solid #ccc",
      fontSize: "16px",
      marginBottom: "10px",
      boxSizing: "border-box",
      transition: "border 0.3s",
    },
    inputError: {
      border: "1px solid red",
    },
    inputFocus: {
      border: "1px solid rgb(21, 75, 10)",
      outline: "none",
    },
    errorText: {
      color: "red",
      fontSize: "14px",
      marginBottom: "10px",
    },
    button: {
      width: "100%",
      padding: "12px",
      backgroundColor: "#003366",
      color: "#ffffff",
      border: "none",
      borderRadius: "10px",
      fontSize: "16px",
      cursor: "pointer",
      marginTop: "10px",
    },
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <div style={styles.imageSection}>
          <img src={imagenLateral} alt="Decoración" style={styles.image} />
        </div>
        <form style={styles.formSection} onSubmit={handleSubmit}>
          <div style={styles.title}>Registro de Usuario</div>

          <label style={styles.label}>Nombre Completo</label>
          <input
            type="text"
            name="nombre"
            value={formData.nombre}
            onChange={handleChange}
            onFocus={() => setFocusedField("nombre")}
            onBlur={() => setFocusedField("")}
            style={{
              ...styles.input,
              ...(errors.nombre && styles.inputError),
              ...(focusedField === "nombre" && styles.inputFocus),
            }}
          />
          {errors.nombre && <div style={styles.errorText}>{errors.nombre}</div>}

          <label style={styles.label}>Email</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            onFocus={() => setFocusedField("email")}
            onBlur={() => setFocusedField("")}
            style={{
              ...styles.input,
              ...(errors.email && styles.inputError),
              ...(focusedField === "email" && styles.inputFocus),
            }}
          />
          {errors.email && <div style={styles.errorText}>{errors.email}</div>}

          <label style={styles.label}>Contraseña</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            onFocus={() => setFocusedField("password")}
            onBlur={() => setFocusedField("")}
            style={{
              ...styles.input,
              ...(errors.password && styles.inputError),
              ...(focusedField === "password" && styles.inputFocus),
            }}
          />
          {errors.password && <div style={styles.errorText}>{errors.password}</div>}

          <label style={styles.label}>Confirmar Contraseña</label>
          <input
            type="password"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
            onFocus={() => setFocusedField("confirmPassword")}
            onBlur={() => setFocusedField("")}
            style={{
              ...styles.input,
              ...(errors.confirmPassword && styles.inputError),
              ...(focusedField === "confirmPassword" && styles.inputFocus),
            }}
          />
          {errors.confirmPassword && (
            <div style={styles.errorText}>{errors.confirmPassword}</div>
          )}

          <button type="submit" style={styles.button}>
            Enviar
          </button>
        </form>
      </div>
    </div>
  );
};

export default Formulario;
